import React, { Component } from "react";
import { render } from "react-dom";
import NewsCard from "../components/NewsCard";
import "../pages/style.css";

const News = () => (
  <div class="container" className="rowC">
    <NewsCard />
  </div>
);

render(<News />, document.getElementById("root"));

export default News;
